import { createUseStyles } from 'react-jss'

export default class Homepage extends React.Component {

    private styles = createUseStyles({
       kaas: {
           backgroundColor: 'red',
       } 
    });

    constructor(props: any) {
        super(props);
    }

    render(): JSX.Element {
        return <h1>homepage</h1>
    }
}
